"use strict"
function cypher(a, b, k, s) {
    let countK = 0;
    let indexAtA;
    let charAtB;
    let char;
    let strOutput = "";

    for (let i = 0; i < s.length; i++) {
        countK = 0;
        char = s.charAt(i);
        while (countK < k) 
        {    
            indexAtA = a.indexOf(char); // 23
            charAtB = b.charAt(indexAtA); // v
            countK++; // 1

            if (countK == k) // k = 2, countK = 1
            {
                strOutput += charAtB; // ""
            }

            char = charAtB;
        }
    }

    return strOutput;
}


